/**
 * Attempts to parse object as JSON.
 * Returns original object if JSON parse failed (silently).
 */
export function _jsonParseIfPossible(obj, reviver) {
    if (typeof obj === 'string' && obj) {
        try {
            return JSON.parse(obj, reviver);
        }
        catch (_a) { }
    }
    return obj;
}
